[[package]]
name = "asttokens"
version = "2.0.5"
summary = "Annotate AST trees with source code positions"
dependencies = [
    "six",
]

[[package]]
name = "backcall"
version = "0.2.0"
summary = "Specifications for callback functions passed in to an API"

[[package]]
name = "colorama"
version = "0.4.5"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"
