requires_python = ">=2.6, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*"
summary = "croniter provides iteration for datetime object with cron like format"
dependencies = [
    "python-dateutil",
]

[[package]]
name = "decorator"
version = "5.1.1"
requires_python = ">=3.5"
summary = "Decorators for Humans"

[[package]]
name = "executing"
version = "0.8.3"
summary = "Get the currently executing AST node of a frame, and other information"

[[package]]
name = "graia-broadcast"
version = "0.18.1"
requires_python = ">=3.7,<4.0"
summary = "a highly customizable, elegantly designed event system based on asyncio"
dependencies = [
    "typing-extensions>=3.10.0; python_version < \"3.9\"",
]

[[package]]
name = "graia-saya"
version = "0.0.16"
requires_python = ">=3.7,<4.0"
summary = ""
dependencies = [
    "graia-broadcast>=0.12.1",
    "loguru<0.7,>=0.5.3",
]

[[package]]
name = "graia-scheduler"
version = "0.0.8"
requires_python = ">=3.7,<4.0"
summary = "a scheduler for graia framework"
dependencies = [
    "croniter<2.0.0,>=1.0.0",
    "graia-broadcast>=0.12.1",
]

[[package]]
name = "ipython"
version = "8.4.0"
requires_python = ">=3.8"
summary = "IPython: Productive Interactive Computing"
dependencies = [
    "appnope; sys_platform == \"darwin\"",
    "backcall",
    "colorama; sys_platform == \"win32\"",
    "decorator",
    "jedi>=0.16",
    "matplotlib-inline",
    "pexpect>4.3; sys_platform != \"win32\"",
    "pickleshare",
    "prompt-toolkit!=3.0.0,!=3.0.1,<3.1.0,>=2.0.0",
    "pygments>=2.4.0",
    "setuptools>=18.5",
    "stack-data",
    "traitlets>=5",
]

[[package]]
name = "jedi"
version = "0.18.1"
requires_python = ">=3.6"
summary = "An autocompletion tool for Python that can be used for text editors."
dependencies = [
    "parso<0.9.0,>=0.8.0",
]

[[package]]
name = "loguru"
version = "0.6.0"
requires_python = ">=3.5"
summary = "Python logging made (stupidly) simple"
dependencies = [
    "colorama>=0.3.4; sys_platform == \"win32\"",
    "win32-setctime>=1.0.0; sys_platform == \"win32\"",
]

[[package]]
name = "matplotlib-inline"
version = "0.1.3"
requires_python = ">=3.5"
summary = "Inline Matplotlib backend for Jupyter"
dependencies = [
    "traitlets",
]

[[package]]
name = "parso"
version = "0.8.3"
requires_python = ">=3.6"
summary = "A Python Parser"

[[package]]
name = "pexpect"
version = "4.8.0"
summary = "Pexpect allows easy control of interactive console applications."
dependencies = [
    "ptyprocess>=0.5",
]

[[package]]
name = "pickleshare"
version = "0.7.5"
summary = "Tiny 'shelve'-like database with concurrency support"

[[package]]
name = "prompt-toolkit"
version = "3.0.29"
requires_python = ">=3.6.2"
summary = "Library for building powerful interactive command lines in Python"
